{{Infobox dungeon |name = Team Galactic HQ |image = [[File:Team_Galactic_HQ.png|300px]] |caption = An view Inside of the Team Galactic HQ. |tokens = 82,500 |location = Veilstone City. }} The '''Team Galactic HQ''' is a [[Dungeons|dungeon]] in [[Sinnoh]]. It initially has 64 tiles arranged in an 8x8 square, including 8 chest tiles, 19 non-boss encounter tiles, and 1 boss encounter tile. Wild Encounters have 1,295,400 HP.
